(function(){$("body").cls("connected");var e=$("#contents").data("id");$.http.get("/api/answers/"+e).on({complete:function(e){var t=e.data,n=t.reduce(function(e,t){return e+t}),r=t.map(function(e){return e/n*100});$("#chart li").each(function(){var e=$(this),n=parseInt(e.data("num"),10),i=Math.floor(r[n])+"%";e.css({width:i});e.find(".percentage").text(i);e.find(".value").text("("+t[n]+")")})}})})();